import React from "react";

const NotFoundBlock = () => {
  return (
    <div className="block">
      <h1>Page not Found</h1>
      <img src="img/error-404.png" alt="Page Not Found" />
      <p>Nothing found for your request</p>
    </div>
  );
};
export default NotFoundBlock;
